package ru.tsutmb.views.editarticle;

import com.vaadin.flow.component.Key;
import com.vaadin.flow.component.button.Button;
import com.vaadin.flow.component.html.H2;
import com.vaadin.flow.component.html.Image;
import com.vaadin.flow.component.html.Paragraph;
import com.vaadin.flow.component.notification.Notification;
import com.vaadin.flow.component.orderedlayout.VerticalLayout;
import com.vaadin.flow.router.PageTitle;
import com.vaadin.flow.router.Route;
import com.vaadin.flow.theme.lumo.LumoUtility.Margin;
import com.wontlost.ckeditor.Constants;
import com.wontlost.ckeditor.VaadinCKEditor;
import com.wontlost.ckeditor.VaadinCKEditorBuilder;
import jakarta.annotation.security.RolesAllowed;
import ru.tsutmb.views.MainLayout;

@PageTitle("Редактирование статьи")
@Route(value = "edit", layout = MainLayout.class)
@RolesAllowed("USER")
public class EditarticleView extends VerticalLayout {

    public EditarticleView() {

        /**Document Editor*/
        VaadinCKEditor decoupledEditor = new VaadinCKEditorBuilder().with(builder->{
            builder.editorType= Constants.EditorType.DECOUPLED;
            builder.editorData="Dcoupled Editor";
        }).createVaadinCKEditor();

        decoupledEditor.setHeight("300px");
        Button sayHello = new Button("Искать");
        sayHello.addClickListener(e -> {
            Notification.show(decoupledEditor.getValue());
        });
        Button sayHello1 = new Button("Искать");
        sayHello1.addClickListener(e -> {
            decoupledEditor.setValue(
                    "&lt;p&gt;&lt;img src=\"data:image/png;base64,\"&gt;Dcoupled Editor&lt;/p&gt;");
        });

        sayHello.addClickShortcut(Key.ENTER);
        setSpacing(false);

        Image img = new Image("images/empty-plant.png", "placeholder plant");
        img.setWidth("200px");

        add(decoupledEditor);
        add(sayHello);
        add(sayHello1);
//
//        H2 header = new H2("This place intentionally left empty");
//        header.addClassNames(Margin.Top.XLARGE, Margin.Bottom.MEDIUM);
//        add(header);
//        add(new Paragraph("It’s a place where you can grow your own UI 🤗"));

        setSizeFull();
        setJustifyContentMode(JustifyContentMode.CENTER);
        setDefaultHorizontalComponentAlignment(Alignment.CENTER);
        getStyle().set("text-align", "center");
    }

}
